package main

import (
	"fmt"
	"testing"
)

type testCase1 struct {
	input    string
	expected int
}

var testCases1 = []testCase1{
	{
		input:    "ABC",
		expected: 10,
	},
	{
		input:    "ABA",
		expected: 8,
	},
	{
		input:    "LEETCODE",
		expected: 92,
	},
	{
		input:    "",
		expected: 681217,
	},
	{
		input: "",
	},
}

func Test_uniqueLetterString(t *testing.T) {
	if true {
		t.Skip()
	}

	for i, v := range testCases1 {
		idx := i
		tst := v

		res := uniqueLetterString(tst.input)
		if tst.expected != res {
			t.Fatal(fmt.Errorf("\n\ntest #%d [%s]\t\texpected=[%d]\t\tresult=[%d]\n\n", idx, tst.input, tst.expected, res))
		}
	}
}
